package com.example.fptacademysystem.dto;public class AttendanceDTO {    private int attenid;    private String present;    private int timetableid;    private int stuid;    public AttendanceDTO(){    }    public int getAttenid() {        return this.attenid;    }    public void setAttenid(int attenid) {        this.attenid = attenid;    }    public String getPresent() {        return this.present;    }    public void setPresent(String present) {        this.present = present;    }    public int getTimetableid() {        return this.timetableid;    }    public void setTimetableid(int timetableid) {        this.timetableid = timetableid;    }    public int getStuid() {        return this.stuid;    }    public void setStuid(int stuid) {        this.stuid = stuid;    }}